const Element = (props) => {
    return ( <div className="flex justify-between">

    <img src={props.img}></img>
    <div>
    <div>{props.title}</div>
    <div>{props.description}</div>
    <div>{props.price}</div>
    </div>
    </div> );
}
 
export default Element;
